import React, { Components } from 'react';

import '../App.css';



class SearchForm extends Components{
  constructor(props) {
    super(props);
    this.state = {value: ''};

    this.handlerCityChange = this.handlerCityChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

     handlerCityChange = (event) => {
      this.setState({value: event.target.value})
    }
    render(){
    return (
      <div className='form-wraper'>
      <form onSubmit={props.getSerchResult} className='search-form' >
          <input className='search-field' value={this.state.value} name='search' placeholder='Search' type='text' onChange={this.handlerCityChange} />
        <button type='submit'>Search</button>
      </form>
      </div>
    )
  }
}

export default SearchForm;



